import React from 'react';
import { FaExchangeAlt, FaHome } from 'react-icons/fa';
import { StyledSideBar, StyledNavLink, StyledIcons } from './styles';

function SideBar() {
    return (
        <StyledSideBar>
            <nav>
                <ul>
                    <li>
                        <StyledNavLink
                            to="/"
                            activeClassName="selected"
                            activeOnlyWhenExact={true}
                        >
                            Home{' '}
                            <StyledIcons>
                                <FaHome />
                            </StyledIcons>
                        </StyledNavLink>
                        <StyledNavLink
                            to="/transactions"
                            activeClassName="selected"
                            activeOnlyWhenExact={true}
                        >
                            Transactions{' '}
                            <StyledIcons>
                                <FaExchangeAlt />
                            </StyledIcons>
                        </StyledNavLink>
                    </li>
                </ul>
            </nav>
        </StyledSideBar>
    );
}

export default SideBar;
